  \"Bayesian Framework Approach for Prognostic Studies in Electrolytic Capacitor under
  Thermal Overstress Conditions\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-02-26T22:03:33.719285\",\n\t\"name\": \"bayesian-framework-approach-for-prognostic-studies-in-electrolytic-capacitor-under-thermal\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Electrolytic capacitors are used in several
  applications rang- ing from power supplies for safety critical avionics equipment
  to power drivers for electro-mechanical actuators. Past expe- riences show that
  capacitors tend to degrade and fail faster when subjected to high electrical or
  thermal stress condi- tions during operations. This makes them good candidates for
  prognostics and health management. Model-based prognos- tics captures system knowledge
  in the form of physics-based models of components in order to obtain accurate predictions
  of end of life based on their current state of health and their anticipated future
  use and operational conditions. The focus of this paper is on deriving first principles
  degradation mod- els for thermal stress conditions and implementing Bayesian framework
  for making remaining useful life predictions. Data collected from simultaneous experiments
  are used to validate the models. Our overall goal is to derive accurate models of
  capacitor degradation, and use them to remaining useful life in DC-DC converters.\",\n\t\"license_title\":
